#include<vector>
using std::vector;

int canCompleteCircuit (vector<int>& gas, vector<int>& cost){
    int n = gas.size();
    int i = 0;
    int count;
    int store;
    while (i<n){
        if (gas[i]==0){
            i++;
            continue;
        }
        count = 0;
        int current = 0;
        for (int j=i;j<i+n;j++){
            int index = j%n;
            current +=(gas[index] - cost[index]);
            if (current<0) {
                store = index;
                break;
            } 
            count++;
        }
        if (count==n) return i;
        else {
            if (store>=i) i = ++store;
            else break;
        }
    }
    return -1;
}

